import React from 'react'
import './n'

export const Navbar = () => {
  return (
    <nav>
      <ul>
        <li><button>Anasayfa</button></li>
        <li><button>Diziler</button></li>
        <li><button>Filmler</button></li>
        <li><button>Listem</button></li>
      </ul>
    </nav>
  )
}

export default Navbar;
